import styles from "./CadastrarAtividade.module.css"
import { NavLink, useNavigate } from 'react-router-dom'
import { useEffect, useState } from "react";
import axios from 'axios';

const api = axios.create({
  baseURL: 'http://localhost:8080'
});

const ListarAtividade = () => {
    const [atividade, setAtividade] = useState([])

    async function status() {
        const url = "http://localhost:8080/atividade/";
        let response = await axios.get(url);
        return response.data;
      }

    useEffect(() => {
        status().then((data) => setAtividade(data))
        console.log(atividade)
    }, [])

    return (
        <list className={styles.formulario}>
            <div className={styles.options}>
                <h3 className={styles.nomesOptions} >Selecione o status</h3>
                <select className={styles.comboBox} onChange={HandleOnChange} name="status" id="status">
                    <option value="">Selecione</option>
                    <option value="ativo">Ativo</option>
                    <option value="inativo">Inativo</option>
                </select>
            </div>

        </list>
    )
}

export default ListarAtividade
